public static List<RuntimeLib> getLibObjects(SolrCore core, List<PluginInfo> libs) {
  List<RuntimeLib> l = new ArrayList<>(libs.size());
  for (PluginInfo lib : libs) {
    RuntimeLib rtl = new RuntimeLib(core);
    rtl.init(lib);
    l.add(rtl);
  }
  return l;
}

